using System;
using System.Globalization;
using CluedIn.Core;
using CluedIn.Core.Data;
using CluedIn.Core.Data.Parts;
using CluedIn.Core.FileTypes;
using CluedIn.Crawling.Factories;
using CluedIn.Crawling.HubSpot.Core;

namespace CluedIn.Crawling.HubSpot.Factories
{
    public class HubSpotClueFactory : ClueFactory
    {
        public HubSpotClueFactory()
            : base(HubSpotConstants.CodeOrigin, HubSpotConstants.ProviderRootCodeValue)
        {
        }

        protected override Clue ConfigureProviderRoot([NotNull] Clue clue)
        {
            if (clue == null)
            {
                throw new ArgumentNullException(nameof(clue));
            }

            // TODO configure validation rule suppressions ... clue.ValidationRuleSuppressions.Add(CluedIn.Core.Constants.Validation.Rules.PROPERTIES_002_Unknown_VocabularyKey_Used);

            var data = clue.Data;
            data.EntityData.Name = "HubSpot CRM";
            data.EntityData.Description = "HubSpot CRM is a web and mobile application for customers.";
            data.EntityData.DisplayName = "HubSpot CRM";
            data.EntityData.Uri = new Uri("https://app.hubspot.com/login");
            data.EntityData.Codes.Add(new EntityCode(EntityType.Product, "CluedIn", "HubSpot"));

            var iconBytes = GetIcon();

            var rawDataPart = new RawDataPart
            {
                Type = "/RawData/PreviewImage",
                MimeType = MimeType.Jpeg.Code,
                FileName = "preview_{0}".FormatWith(clue.OriginEntityCode.Key),
                RawDataMD5 = FileHashUtility.GetMD5Base64String(iconBytes),
                RawData = Convert.ToBase64String(iconBytes)
            };

            clue.Details.RawData.Add(rawDataPart);

            clue.Data.EntityData.PreviewImage = new ImageReferencePart(rawDataPart, 128, 128);
            clue.Data.EntityData.Properties.Add("Created", DateTime.UtcNow.ToString(CultureInfo.InvariantCulture));

            return clue;
        }

        private static byte[] GetIcon()
        {
            return
                Convert.FromBase64String(
                    @"");
        }
    }
}
